angular.module("recipes").run(["$templateCache", function($templateCache) {$templateCache.put("editable/editable.html","\n<label>{{attribute}}\n  <input ng-model=\"model\"/>\n</label>");
$templateCache.put("model/model.html","\n<div> \n  <div ng-click=\"toggle(model)\" class=\"title\">{{model[display] || \'Click to Edit Recipe \' + model[key]}}</div>\n  <div ng-show=\"expanded[model[key]]\" class=\"panel\">\n    <editable ng-if=\"attributes[attribute]\" ng-repeat=\"(attribute, value) in model\" attribute=\"{{attribute}}\" model=\"model[attribute]\"></editable>\n    <button ng-click=\"save(model)\">Save</button>\n    <button ng-click=\"delete(model)\">Delete</button>\n  </div>\n</div>");
$templateCache.put("recipes/recipes.html","\n<button ng-click=\"newRecipe()\">Create New Recipe</button>\n<model ng-repeat=\"recipe in recipes\" model=\"recipe\" key=\"id\" display=\"name\" attributes=\"attributes\" class=\"recipe col-xs-12\"></model>");}]);